import { Grid, Button, ButtonGroup } from "@material-ui/core";

interface ILogin {
  loginclass: string;
  signupclass: string;
  match: boolean;
}

export function Login({ loginclass, signupclass, match }: ILogin) {
  return (
    <Grid
      container
      className={match ? "containerloginpc" : "containerloginmobile "}
      item
      xs={12}
    >
      <Grid item sm={5}></Grid>
      <Grid item className="buttonpad buttonshake" xs={12} sm={2}>
        <Button
          className={loginclass}
          fullWidth={true}
          variant="outlined"
          size="large"
          color="primary"
        >
          Login
        </Button>
      </Grid>
      <Grid item sm={12}></Grid>

      <Grid item sm={5}></Grid>
      <Grid item className="buttonpad buttonshake" xs={12} sm={2}>
        <Button
          className={signupclass}
          fullWidth={true}
          variant="contained"
          size="large"
          color="secondary"
        >
          {" "}
          Signup
        </Button>
      </Grid>
    </Grid>
  );
}
